<!DOCTYPE html>
<html>
<head>
<style>
ul.a {
  list-style-type: circle;
}

ul.b {
  list-style-type: square;
}

</style>
</head>
<body>

<h2>List Takjil</h2>

<p>Makanan:</p>
<ul class="a">
  <li>Gorengan</li>
  <li>Kolak</li>
  <li>Kue Putu</li>
</ul>

<ul class="b">
  <li>Dimsum</li>
  <li>Martabak</li>
  <li>Bubur Candil</li>
</ul>

</body>
</html>
